                <NavLink to="/landlords">Landlords</NavLink> <span>&nbsp;&nbsp;</span>

                <NavLink to="/landlords/new">Create Landlord</NavLink> <span>&nbsp;&nbsp;</span>
                {/* <li><NavLink to="/landlords/:id/houses/new">Create House</NavLink></li> */}


